package dis

import "testing"

func TestKthDistance(t *testing.T) {
	st := []struct {
		name   string
		nums   []int
		k, exp int
	}{
		{"two elements", []int{1, 2}, 1, 1},
		{"test_k1", []int{1, 3, 1}, 1, 0},
		{"test_k2", []int{1, 3, 1}, 2, 2},
		{"failed_k2", []int{2, 0, 1, 1, 0, 0, 1, 2, 0}, 2, 0},
	}
	for _, c := range st {
		t.Run(c.name, func(t *testing.T) {
			ret := KthDistance(c.nums, c.k)
			if ret != c.exp {
				t.Fatalf("expected %d but got %d with input %v and %d",
					c.exp, ret, c.nums, c.k)
			}
		})
	}
}

